import {AppBar, Box, Button, Container, Toolbar, Typography} from '@mui/material'
import { Link, Navigate, useNavigate } from 'react-router-dom'


function Menu() {
  
const navigate = useNavigate();
  return (
    <Box sx={{flexGrow: 1}}> {/**recuadro */} {/** el sx es para indicar que el tamaño en pantallas pequeñas Y que abarque todo el ancho disponible*/}
      <AppBar position='static' color='transparent'>{/**navegacion, le damos los estilos  */}
        <Container>{/**para centrarlo */}
          <Toolbar> {/** son las opciones del menu */}
              <Typography variant='h6' sx={{flexGrow: 1}}>{/** aqui se colocan los textos dentro de material ui */}
                  <Link to='/' style={{textDecoration: "none", color: "#eee"}}> {/** viene de router y se encarga de llevarnos a la ruta es como un a de html */}
                    PERN STACK
                  </Link>
              </Typography>
              <Button variant='contained' color='primary' onClick={ () => navigate("/usuarios/nuevo")}> {/**se usa
               * el useNavigate para pasar una ruta
               */}
                      Nuevo Usuario
              </Button>
          </Toolbar>
        </Container>
      </AppBar>
    </Box>
  )
}

export default Menu
